from __future__ import annotations

import dataclasses
from typing import TypeVar, Generic, Union, Callable, Any

T = TypeVar('T')
U = TypeVar('U')

@dataclasses.dataclass(frozen=True)
class Ok(Generic[T]):
    value: T

    def is_ok(self) -> bool:
        return True

    def is_err(self) -> bool:
        return False

    def and_then(self, fn: Callable[[T], Result[U]]) -> Result[U]:
        return fn(self.value)

@dataclasses.dataclass(frozen=True)
class Err:
    error: str

    def is_ok(self) -> bool:
        return False

    def is_err(self) -> bool:
        return True

    def and_then(self, fn: Callable[[Any], Result[U]]) -> Result[U]:
        return self  # type: ignore

Result = Union[Ok[T], Err]

def parse_int(s: str) -> Result[int]:
    try:
        return Ok(int(s))
    except ValueError:
        return Err("Invalid integer")

def divide_safe(a: int, b: int) -> Result[int]:
    if b == 0:
        return Err("Division by zero")
    return Ok(a // b)

# Test cases
# parse_int("10") then divide by 2 -> "Result: 5"
result_1 = parse_int("10").and_then(lambda n: divide_safe(n, 2))
if result_1.is_ok():
    print(f"Result: {result_1.value}")
else:
    print(f"Error: {result_1.error}")

# parse_int("10") then divide by 0 -> "Error: Division by zero"
result_2 = parse_int("10").and_then(lambda n: divide_safe(n, 0))
if result_2.is_ok():
    print(f"Result: {result_2.value}")
else:
    print(f"Error: {result_2.error}")

