type List[a] = Cons(a, List[a]) | Nil

export func filter[a](pred: func(a) -> bool, xs: List[a]) -> List[a] {
  match xs {
    Nil => Nil,
    Cons(x, xs2) => if pred(x) then Cons(x, filter[a](pred, xs2)) else filter[a](pred, xs2)
  }
}

export func map[a, b](f: func(a) -> b, xs: List[a]) -> List[b] {
  match xs {
    Nil => Nil,
    Cons(x, xs2) => Cons(f(x), map[a, b](f, xs2))
  }
}

export func foldl[a, b](f: func(b, a) -> b, acc: b, xs: List[a]) -> b {
  match xs {
    Nil => acc,
    Cons(x, xs2) => foldl[a, b](f, f(acc, x), xs2)
  }
}

export func main() -> () ! {IO} {
  let nums = Cons(1, Cons(2, Cons(3, Cons(4, Cons(5, Cons(6, Cons(7, Cons(8, Cons(9, Cons(10, Nil))))))))));
  let evens = filter[int](func(n: int) -> bool { n % 2 == 0 }, nums);
  let squares = map[int, int](func(n: int) -> int { n * n }, evens);
