type Tree = Leaf(int) | Node(Tree, int, Tree)

export func tree_sum(tree: Tree) -> int {
  match tree {
    Leaf(v) => v,
    Node(l, v, r) => tree_sum(l) + v + tree_sum(r)
  }
}

export func find_max(tree: Tree) -> int {
  match tree {
    Leaf(v) => v,
    Node(Leaf(lv), v, Leaf(rv)) => {
      let m1 = if lv >= v then lv else v;
      if m1 >= rv then m1 else rv
    },
    Node(l, v, r) if v >= find_max(l) => {
      let rm = find_max(r);
      if v >= rm then v else rm
    },
    Node(l, v, r) => {
      let lm = find_max(l);
      let rm = find_max(r);
      let mv = if lm >= v then lm else v;
      if mv >= rm then mv else rm
    }
  }
}

export func main() -> () ! {IO} {
  let tree = Node(Leaf(1), 5, Node(Leaf(3), 7, Leaf(2)));
  let s = tree_sum(tree);
  let m = find_max(tree);
  println("Sum: " ++ show(s));
  println("Max: " ++ show(m))
}

